import React from "react";

class Users extends React.Component {
  users = [
    {
        id: 1,
        firstname: "Vadim",
        lastname: "Khakimyanov",
        bio: 'Программист получаеца',
        age: 27,
        isHappy: true
    },
    {
        id: 2,
        firstname: "Ruslan",
        lastname: "Melnikov",
        bio: 'Студент получаеца',
        age: 18,
        isHappy: true
  },
  ]
  render() {
  return (
      <div>
        {this.users.map((e) => (<div>
              <h3>{e.firstname} {e.lastname}</h3>
              <p>{e.bio}</p>  
          </div>))}
      </div>
  )
}
}

export default Users
